.container {
  display: flex;
  padding: 10px 10px;

  .case-info {
    display: flex;
    flex-direction: column;
    width: 40%;

    .ring-card {
      height: 240px;

      .ring {
        transform: translateY(-90px);
      }
    }

    .case-list {
      margin-top: 10px;
      height: 440px;

      .progress-div {
        margin-top: 100px;
        width: 100%;
        display: flex;
      }

      .case-title {
        height: 30px;
        width: 98%;
        border:1px solid #b3d8ff;
        margin-bottom: 6px;
        display: flex;
        align-items: center;

        .icon {
          margin-left: 10px;
        }

        .title {
          margin-left: 10px;
        }
      }

      .case-title-normal {
        @extend .case-title;
        color: #409EFF;
        background: #ecf5ff;
      }

      .case-title-choose{
        @extend .case-title;
        color: #ecf5ff;
        background: #409EFF;
      }
    }
  }

  .case-detail {
    margin-left: 10px;
    width: 60%;
    height: 690px;

    .header {
      display: flex;
      align-items: flex-end;
      justify-content: space-between;

      .title {
        color: $parent-title-color;
        font-size: 20px;
        font-weight: 500;
      }

      .info-list {
        display: flex;
        align-items: center;

        .response-info-title {
          font-size: 12px;
          color: #909399;
          margin-right: 10px;
        }

        .success {
          display: flex;
          font-size: 12px;
          margin-right: 10px;
          color: #0ec23b;
        }

        .warning {
          display: flex;
          font-size: 12px;
          margin-right: 10px;
          color: #E6A23C;
        }

        .error {
          display: flex;
          font-size: 12px;
          margin-right: 10px;
          color: #c20215;
        }
      }
    }

    .assert {
      margin-top: 10px;
    }

    .response-text {
      margin-top: 10px;
      word-wrap: break-word;
      word-break: normal;
    }

  }

}
